import classes from "./CartItem.module.css";

const CartItem = (props) => {
  return (
    <li className={classes.itemlist}>
      <span>
        <div>
          {props.name} x {props.amount}
        </div>
        <div>{props.price}</div>
      </span>
    </li>
  );
};

export default CartItem;
